from sympy import divisors, factorint
def a(n):
    npf = len(factorint(n, multiple=True))
    for d in divisors(n):
        if len(factorint(d, multiple=True)) == (npf+1)//2: return d
    return 1
print([a(n) for n in range(1, 81)]) # _Michael S. Branicky_, Aug 18 2021

